@EliotACohen Ukraine is already negotiating with Russia. 

Their opening gambit is soooo far out of the ballpark that they will loose another hundred thousand soldiers dead before Ukrainians overthrow Zelensky and call for more sensible negotiations. 

Mark my words.

@thesiriusreport Dishonest of you to suggest Ukraine wasn't giving a serious consideration to the idea of peace talks.

Ukraine held peace talks with Russia in March.

The peace talks FAILED.

@neil_abrams @aaronjmate False premiss "the Donbas war between Russia and Ukraine"

The ICJ has never stated it was a war between Russia and Ukraine. That's because it wasn't and Ukraine never claimed it at the time.

Russia stated it wasn't a party to the conflict.
